function Profile({ user }) {

  return (
    <>
      <h1>{user.name}</h1>
      <img
        className='avatar'
        src={user.imageUrl}
        alt={'Photo of ' + user.name}
        style={{
          width: user.imageSize,
          height: user.imageSize
        }}
      />
    </>
  );
}

function ButtonExample() {
  // el setstate se usa para cambiar los estados variables
  // const [count, setCount] = useState(0);

  //Obtener el valor del estado de la variable
  const number = useSelector(state => state.number.value);

  // Cambiar el valor del estado de la variable
  const dispatch = useDispatch();

  return (
    <>
      <button className='bg-blue-500 hover:bg-blue-700 rounded text-blue-50 font-bold py-2 px-4' 
        onClick={() => dispatch(increaseNumber())}>Sumar</button>
      <button className='bg-red-500 hover:bg-red-700 rounded text-red-50 font-bold py-2 px-4' 
        onClick={() => dispatch(decreaseNumber())}>Restar</button>
      <p>El contador va en: {number}</p>
    </>
  )
}

